        function filtrarProductos() {
            const busqueda = document.getElementById('busqueda').value.trim().toLowerCase();
            const listaResultados = document.getElementById('listaResultados');

            // Limpiar la lista antes de mostrar los resultados actualizados
            listaResultados.innerHTML = '';

            // Filtrar productos según la búsqueda
            const resultados = productos.filter(producto =>
                producto.nombre.toLowerCase().includes(busqueda) || producto.distribuidora.toLowerCase().includes(busqueda)
            );

            // Mostrar resultados
            resultados.forEach(producto => {
                const li = document.createElement('li');
                li.textContent = `${producto.nombre} - ${producto.distribuidora}`;
                listaResultados.appendChild(li);
            });
        }

        // Mostrar todos los productos al cargar la página
        window.onload = filtrarProductos;
